import React from 'react';

const InvoiceInfo = () => {
    return (
        <div className={'invoice-info-wrapper'}>

            <div className='background'></div>

            <h2 className={'invoice-id'} >invoiceId</h2>
            <h4 className="invoice-patient">patient name</h4>
            <h6>patient mobile</h6>
            <h6>issued at </h6>
            <h6>description</h6>
            <h6>treatment</h6>
            <h6>amountPayed</h6>
            <h6>charged</h6>
            <h6>dueAmount</h6>
        </div>
    );
};

export default InvoiceInfo;
